INSERT INTO `products` (`productid`, `name`, `category`, `subCategory`, `description`, `stock`, `amountSold`, `price`) VALUES
(4, 'Call of Duty: World War II', 'Games', 'PlayStation 4', 'Call of Duty® returns to its roots with Call of Duty®: WWII—an experience that redefines World War II for a new gaming generation. Call of Duty®: WWII tells the story of heroism on a global scale, through the unbreakable brotherhood of common men fighting to preserve freedom in a world on the brink of tyranny.', 1000, 356, '49.00'),
(5, 'Crash Bandicoot N. Sane Trilogy', 'Games', 'PlayStation 4', 'Your favorite marsupial, Crash Bandicoot®, is back! He’s enhanced, entranced & ready-to-dance with the N. Sane Trilogy game collection. ', 258, 75, '29.99'),
(6, 'Star Wars Battlefront II: Elite Trooper Deluxe Edition', 'Games', 'PlayStation 4', 'The Star Wars Battlefront II: Elite Trooper Deluxe Edition turns your troopers into the ultimate opponents. Every trooper class (Officer, Assault, Heavy, and Specialist) is upgraded, delivering superior firepower, deadly weapon modifications, and epic combat abilities. ', 658, 125, '79.99'),
(7, 'Grand Theft Auto V', 'Games', 'PlayStation 4', 'Experience Rockstar Games'' critically acclaimed open world game, Grand Theft Auto V.\r\nWhen a young street hustler, a retired bank robber and a terrifying psychopath find themselves entangled with some of the most frightening and deranged elements of the criminal underworld, the U.S. government and the entertainment industry, they must pull off a series of dangerous heists to survive in a ruthless city in which they can trust nobody, least of all each other.', 665, 89, '29.99'),
(8, 'Overwatch: Origins Edition', 'Games', 'PlayStation 4', 'Soldiers. Scientists. Adventurers. Oddities.\r\nIn a time of global crisis, an international task force of heroes banded together to restore peace to a war-torn world: Overwatch.\r\n', 558, 154, '24.99'),
(9, 'Rocket League', 'Games', 'PlayStation 4', 'Take control of your own high-flying, hard-hitting, rocket-powered Battle-Car in the critically-acclaimed, futuristic Sports-Action hit, Rocket League: Collector''s Edition!', 985, 354, '17.99'),
(10, 'Tom Clancy''s The Division', 'Games', 'PlayStation 4', 'A devastating pandemic sweeps through New York City, and one by one, basic services fail in Tom Clancy''s The Division on PlayStation 4.\r\nEnter a universe where the time of day and weather conditions deeply impact your gaming experience.\r\nHarness state-of-the-art technology and customize and level up your weapons.\r\nEnjoy a seamless multiplayer experience as you team up with friends to take down your enemies and achieve group objectives.', 785, 689, '14.99'),
(11, 'Fifa 17', 'Games', 'PlayStation 4', 'Immerse yourself in the beautiful game like never before in FIFA 17 on PS4. Now powered by the Frostbite engine, FIFA 17 delivers a more in-depth and authentic football experience than ever before. With improvements at both ends of the pitch, FIFA 17 gives you more control in both attack and defence, allowing you to create realistic and unforgettable games.', 856, 425, '24.99'),
(12, 'Skyrim Special Edition', 'Games', 'PlayStation 4', 'Winner of more than 200 Game of the Year Awards, Skyrim Special Edition brings the epic fantasy to life in stunning detail. The Special Edition includes the critically acclaimed game and add-ons with all-new features like remastered art and effects, volumetric god rays, dynamic depth of field, screen-space reflections, and more. ', 546, 214, '24.99'),
(13, 'Injustice 2 Deluxe Edition with Steelbook', 'Games', 'PlayStation 4', 'Injustice 2 is the super-powered sequel to the hit game Injustice: Gods Among Us that allows players to build and power up the ultimate version of their favorite DC characters. Featuring a massive selection of DC Super Heroes and Super-Villains, players can personalize iconic DC characters with unique and powerful gear earned throughout the game.  Additionally, for the first time, gamers can take control of how their characters look, fight and develop across a variety of game modes.', 852, 258, '59.99'),
(14, 'Outlast Trinity', 'Games', 'PlayStation 4', 'Outlast is a first-person survival horror series developed by Red Barrels. The critically acclaimed franchise is now available for the first time on disc as a complete package. Outlast: The Ultimate Horror Bundle features over 20 hours of terrifying gameplay across Outlast 1, Outlast Whistleblower and the all new Outlast 2.', 1154, 956, '29.99');

